                },
                {
                    itemID: "2",
                    name: "bracelet",
                    gender: "men",
                    price: 25,
                    mainFoto: getlink("main.webp?alt=media&token=90c0b664-df6c-4fb2-a29a-2e4ca81ba597"),
                    fotos: getAllLinks("2.webp?alt=media&token=f5e92a17-c830-404b-9619-61aeebe7e7f7","3.webp?alt=media&token=9c6173d0-57c2-40b2-b883-1a9477134bb8")
                },

            ],
            woman : [],
            kids: [],
        },
        bags : {
            men: [],
            woman : [],
            kids: [],
        },
        denim : {
            men: [],
            woman : [],
            kids: [],
        },
        "t-shirts" : {
            men: [],
            woman : [],
            kids: [],
        }
    }


}
export const productsReducer = (state = initialState, action) => {
    switch (action.type) {
        default:
            return state
    }
}
